import Link from "next/link";

const Navbar = () => (
	<div>
		<ul>
			<li>
				<Link href='/'>
					<div>Home</div>
				</Link>
			</li>
			<li>
				<Link href='/about'>
					<div>About</div>
				</Link>
			</li>
		</ul>
		<style jsx>{`
			ul {
				background: green;
			}
		`}</style>
	</div>
);

export default Navbar;
